import styled from "styled-components";
import { colors } from "../../../variables";

export const BottomBar = styled.div`
  align-self: flex-end;
  margin-bottom: 8vh;
  width: 90vw;
  height: 5vh;
  background-color: ${colors.textBackground};
  display: flex;
  flex-direction: row;
`;
